import React, { Component } from 'react';
import * as d3 from "d3";

class DataVis extends Component {
  drawCircles() {
    if (this.props.data) {
      const xScale = this.props.xScale;
      const yScale = this.props.yScale;
      /* eslint-disable no-console */
      console.log(this.props.xScale)
      d3.select(this.groupEl)
        .selectAll("circle")
        .data(this.props.data)
        .enter()
        .append("circle")
        .attr("cx", function(d) {
          return xScale(d.x);
        })
        .attr("cy", function(d) {
          return yScale(d.y);
        })
        .attr("r", 10)
        .attr("fill", "aqua");
    }
  }

  render() {
    this.drawCircles()
    return (
      <g ref={el => this.groupEl = el} className="test"></g>
    );
  }

}

export default DataVis;
